import React, { Component } from 'react';
import { gql } from 'apollo-boost'
import { graphql } from 'react-apollo'

const GET_TEAMS_QUERY = gql`
  {
    drivers {
      id
      firstName
      lastName
      nationality
      team {
        name
      }
    }
  }
`;

class TeamList extends Component {
    render() {
        return (
            <div>
                <ul id="team-list">
                    {this.Teams}
                </ul>
            </div>
        );
    }
}

export default graphql(GET_TEAMS_QUERY)(TeamList);
